import './App.css';
import React from 'react';
import { Route, Routes } from 'react-router-dom'; // No need to import Router
function App() {
  const navigate = useNavigate();

  const goToPage = (path) => {
    navigate(path); // This will navigate to the given path
  };

  return (
    <div className="App">
      <header className="App-header">
        <p>Test</p>
        <button onClick={() => goToPage('/add')}>Go to About Page</button>
        <button onClick={() => goToPage('/edit')}>Go to Contact Page</button>
      </header>
    </div>
  );
}

export default App;
